import React from "react";
import "../../App.css";
import { Link } from "react-router-dom";
import foto from "../../images/earth.gif";
import { useEffect } from "react";
import { Blob } from "react-blob";
import "./Home.css";

import HandHoldingPhone from "../../images/HandHoldingPhone.png";

export default function DVox() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <>
      <Link to="/projects">Go back to projects</Link>
      <div className="dvoxtext">
        <h1>DVox</h1>
      </div>
      {/* this is the second section with the image of DVox and description */}
      <div>
        <div>


          <div className="imagePicture">
            <h1 className="vyt">Voice your thoughts</h1>
            <img className="handHoldingPhone" src={HandHoldingPhone}/>
          </div>


          <div className="bg-Logo-right"></div>
        </div>
      </div>

      {/* this is the third section with an image of DVox and description */}
      <div className="home-sec">
        <div className="homeFlex">
          <div className="bg-Logo-right"></div>
          <div className="description-pos">
            <h1>ay yo</h1>
          </div>
        </div>
      </div>
      {/* this will be the form to join */}
      <div className="home-secBlack"></div>
    </>
  );
}
